class service {

  /* @ngInject */
  constructor(ModelService, UtilsService) {
    this.ModelService = ModelService;
    this.UtilsService = UtilsService;
  }

  isCharity() {
    const match = this.UtilsService.lookupSelection(businessTypes, this.ModelService.model.legalEntityType);
    return match === 'Charity';
  }

  getById(/* id */) {
    const id = this.ModelService.model.businessType;

    let item;
    for(let i=0, len=data.length ; i<len ; i++) {
      item = data[i];
      if (item.id === id) {
        // fix for Amex rates on Charity
        if (this.isCharity()) {
          item.amexRate = 1.6;
        }
        return item;
      }
    }

    // dummy record - invoking 'call us'
    return {
      id,
      mcc: '0000',
      color: 'RED',
      text: 'Unknown',
      open: false,
      route: false,
      lessThan1:false,
      lessThan2:false,
      lessThan5:false,
      moreThan5:false,
      allowTopUp: false,
      allowPreAuth:false,
      allowCashBack: false,
      amexRate: 0,
      synonyms: ''
    };
  }
}

export default angular.module('wcy.services.mcc', [])
  .service('MccService', service)
  .name;
